window.bookSummaryJSON = "<p><b>More than 100 million copies sold worldwide.</b></p> <p>When unworldly student Anastasia Steele first encountered the driven and dazzling young entrepreneur Christian Grey it sparked a sensual affair that changed both of their lives irrevocably. Shocked, intrigued, and, ultimately, repelled by Christian’s singular erotic tastes, Ana demands a deeper commitment. Determined to keep her, Christian agrees.&nbsp;</p> <p>Now, Ana and Christian have it all - love, passion, intimacy, wealth, and a world of possibilities for their future. But Ana knows that loving her Fifty Shades will not be easy, and that being together will pose challenges that neither of them would anticipate. Ana must somehow learn to share Christian’s opulent lifestyle without sacrificing her own identity. And Christian must overcome his compulsion to control as he wrestles with the demons of a tormented past.&nbsp;</p> <p>Just when it seems that their strength together will eclipse any obstacle, misfortune, malice, and fate conspire to make Ana’s deepest fears turn to reality.</p> <p><b>This audiobook is intended for mature audiences.</b></p> <p>Look for E L James’ passionate new love story, <i>The Mister</i>, coming April 16, 2019.&nbsp;</p>"; 
